#include <string>
#include <unordered_map>
#include <vector>

class Solution {
public:
    long long beautifulSubstrings(string s, int k) {
        long long count = 0;
        int n = s.length();
        std::vector<int> prefixVowels(n + 1, 0), prefixConsonants(n + 1, 0);

        // Calculate prefix sums for vowels and consonants
        for (int i = 0; i < n; ++i) {
            prefixVowels[i + 1] = prefixVowels[i] + (s[i] == 'a' || s[i] == 'e' || s[i] == 'i' || s[i] == 'o' || s[i] == 'u');
            prefixConsonants[i + 1] = prefixConsonants[i] + !(s[i] == 'a' || s[i] == 'e' || s[i] == 'i' || s[i] == 'o' || s[i] == 'u');
        }

        // Check every possible substring
        for (int i = 0; i < n; ++i) {
            for (int j = i + 1; j <= n; ++j) {
                int vowels = prefixVowels[j] - prefixVowels[i];
                int consonants = prefixConsonants[j] - prefixConsonants[i];
                if (vowels == consonants && (vowels * consonants) % k == 0) {
                    ++count;
                }
            }
        }

        return count;
    }
};
